import React from 'react'
import api from '../api'
const Indexpage = () => {
    // Create state variables
    let [responseData, setResponseData] = React.useState('')
    // fetches data
    const fetchData = (e) => {
        e.preventDefault()
        api.getData()
        .then((response)=>{
            setResponseData(response.data)
            console.log(response)
        })
        .catch((error) => {
            console.log(error)
        })
    }
    return (
        <>
        <ul>
            {fetchData().map((res) => {
            
           return <li key={res._id}>{res.productname}</li>;
            })}
        </ul>
        </>
    )
}
export default Indexpage;
